import React from 'react'
import {Navigate} from "react-router-dom"
function PrivateRoute({children}) {
    const token=localStorage.getItem('token')
    
  
  return (
    <div>
        {token ?  children : <Navigate to="/auth/sign-in"/>}
    </div>
  )
}

export default PrivateRoute
